import React from 'react';

import './card.css';

const Card = (props) => {
  return (
    <div className="card">
      <div className="img">
        <img src={props.data.i}/>
        <div className="like"></div>
      </div>
      <h3>{props.data.name}</h3>
      <h4>{props.data.year}</h4>
    </div>
  );
};

export default Card;
